import './App.css';
import Home from './pages/home/Home';
import {ToastContainer} from "react-toastify";

function App() {
  return (
    <div className="App">
      <Home />
        <ToastContainer theme={"colored"} position={"top-center"}/>
    </div>
  );
}

export default App;
